INSERT INTO `comments` VALUES (1,13,192,'Fun problem. May be a bit soft for a V4 with the correct beta.','2015-01-03 16:40:04'),(2,20,171,'Probably one of the best routes in the gym right now. Very different from anything ever set and not super hard just moves most ppl are not use to','2015-01-03 20:13:00'),(3,20,172,'Very fun route!','2015-01-03 20:13:59'),(4,20,174,'Should have been harder after the start moves... It starts off as a great route hen just turns into a V1','2015-01-03 20:15:32'),(5,20,72,'Great route very fun swing through','2015-01-03 20:17:52'),(6,20,117,'Great route heady finish','2015-01-03 20:19:39'),(7,21,197,'Super dope.','2015-01-04 19:38:29'),(8,20,15,'Great route I like the slight run out','2015-01-16 19:07:27'),(9,20,118,'Great route flows amazing and has perfect hold placement for climbing','2015-01-16 19:08:09'),(10,20,118,'Clipping','2015-01-16 19:08:17'),(11,20,207,'I normally love dihedral routes but this one just didn\'t make much of a fun route.','2015-01-16 19:09:39'),(12,20,229,'This route is clearly missing a foot hold in the middle going to the volume or the foot hold placement is off','2015-01-16 19:12:59'),(13,20,226,'Greg route for insight training. Next to impossible to read from the ground and makes you work and think it through slowly','2015-01-16 19:15:16'),(14,20,212,'Burly up top','2015-01-16 19:16:21'),(15,20,85,'Fun problem','2015-01-16 19:43:31'),(16,20,25,'Long pumpy route great for running laps.','2015-01-16 19:45:36'),(17,13,342,'Really fun problem!','2015-03-02 17:21:18'),(18,13,343,'Liked the crux move in the middle.','2015-03-02 17:23:32'),(19,13,354,'Fun problem but felt a bit soft for a V5','2015-03-02 17:37:05'),(20,13,339,'Move to bubble wrap was fun. Multiple betas for finish was interesting to see and work out.','2015-03-02 22:06:18'),(21,4,359,'Awesome heel hook towards the end','2015-03-06 12:27:34'),(22,52,372,'Oof. That last move is brutal. Definitely a climb that challenged me to make some sketchy moves.','2015-04-01 08:20:54'),(23,61,428,'This route is rated as a 5.8 in the gym.','2015-04-08 22:04:04'),(24,98,634,'Probably my favorite V4!','2015-05-17 19:03:19'),(25,99,634,'First V4 ????','2015-05-18 15:56:21'),(26,108,595,'The start is exciting but a big iron cross type dyno across the roof would have been fun.','2015-05-27 16:29:20'),(27,108,662,'Solid start and some big moves, great warm up.','2015-05-27 16:35:27'),(28,108,627,'The cross around the diamond is good, finishing from there is short and strong.','2015-05-27 16:50:41'),(29,108,607,'Huge moves, juggy traverse to a big finish. The one hold in the middle was a surprise.','2015-05-27 16:55:09'),(30,108,602,'It\'s fun trying to go straight to the finish from the first move.','2015-05-27 16:57:37'),(31,108,596,'The far right hand before the finish seemed like a big move for shorter climbers, the finish itself felt natural.','2015-05-27 16:59:01'),(32,108,594,'Starting was tricky, the rest felt like a nice balance between power and technique. Finished hard but fun.','2015-05-27 17:01:52'),(33,113,664,'awesome route! it was my first 5','2015-06-02 23:22:21'),(34,1,668,'One of my favorites','2015-06-03 01:56:53'),(35,95,685,'Doesn\'t feel like an 8','2015-06-12 07:42:07'),(36,95,676,'Is this the Yellow 5.8?  No way this is an 8.','2015-06-12 07:44:11'),(37,101,871,'Awesome route! Love the first move.','2015-06-16 19:24:32'),(38,76,881,'Campused it :P','2015-06-22 14:55:42'),(39,52,859,'The match before the last move is getting harder as time goes because the hold is getting greasier.','2015-06-23 09:53:48'),(40,108,878,'http://i.imgur.com/9sMKHHh.jpg','2015-06-24 00:38:50'),(41,108,876,'http://i.imgur.com/YhAhxJx.jpg','2015-06-24 00:39:07'),(42,108,884,'http://imgur.com/9sMKHHh,YhAhxJx,QuV16ac,zENU0ye,cLvuSCZ#2','2015-06-24 00:39:34'),(43,108,881,'http://i.imgur.com/zENU0ye.jpg','2015-06-24 00:40:18'),(44,108,880,'http://i.imgur.com/cLvuSCZ.jpg','2015-06-24 00:40:44'),(45,4,881,'http://i.imgur.com/zENU0ye.jpg','2015-06-28 14:16:15'),(46,47,912,'Really fun movement','2015-06-30 20:31:07'),(47,122,902,'Feet right where you want them.','2015-07-01 10:21:36'),(48,102,912,'Awesome movement throughout the route. The start is what makes it a 7.','2015-07-01 12:11:36'),(49,1,994,'Hey','2015-07-11 17:13:47'),(50,144,848,'Fun back and forth route!','2015-07-12 19:41:05'),(51,144,846,'Funky project. Not like anything I\'ve encountered before.','2015-07-12 19:41:46'),(52,144,832,'','2015-07-12 19:42:40'),(53,47,1063,'Currently says right grey but this is the new diamond wall set','2015-07-20 17:56:01'),(54,122,650,'Fantastic outdoor training route. Good movement.','2015-07-22 14:34:25'),(55,47,1276,'Cool dyno, easy finish','2015-09-19 22:26:32'),(56,101,1404,'One of the coolest TR routes I\'ve climbed at Aiguille!','2015-12-04 00:25:23'),(57,175,1408,'That second move... phew','2015-12-10 12:17:28'),(58,189,1517,'Hard for the grade.','2015-12-31 15:36:21'),(59,189,1509,'Low end V7.','2015-12-31 15:38:27'),(60,189,1511,'Hard for the grade','2015-12-31 15:39:02'),(61,189,1520,'Mega project. Breaks down as two V8\'s stacked with no rests.','2015-12-31 15:39:51'),(62,189,1521,'This funboy likes the fluid sequencing ja','2015-12-31 15:47:12'),(63,189,1524,'Low end V8','2015-12-31 15:59:39');
