INSERT INTO `suggestions` VALUES (4,2,'Include unrated routes in total # of routes per setter'),(7,37,'A different default gym picture would be beneficial, right now the giant x over the camera may scare some users away.  I would suggest maybe a light grey silhouette of a climbing wall with a climber on it, like you see in a lot of gym logos.'),(13,52,'I think it would be nice to track the type of send for the route (i.e. onsight, flash, redpoint, project, etc.).  Just make sure those terms are defined somewhere since they tend to be pretty loosely defined to begin with.\n\nAlso, I\'m not sure whether it was the intent of this project, but I think it would be nice to track multiple sends of any given route; possibly a \"Sent Again\" button.  I imagine this might be helpful for setters to see which routes are the most popular.'),(14,37,'It\'s not letting me select a rating after sending a route on mobile'),(15,122,'For the wall with routes that you can toprope or lead, each route is listed twice which is good, but there is no way to differentiate between them'),(16,122,'All the routes on wall 24 have the correct color when they are listed together, but all are red when you select them.'),(17,122,'Is the difficulty listed at the top of my profile supposed to be an average? It is listing the highest for my bouldering, but averages for toprope and lead.'),(18,144,'Would be nice for users to be able to add routes if the gym isn\'t adding them. Same with gyms. \n\nWould also be nice to be able to track progress at more than 1 gym.  I climb in Miami, Ontario, and at Rock Spot in RI. Would be nice to be able to add the gyms that aren\'t up yet.'),(19,146,'I would like to see a \"flashed\" send button, and maybe being able to create a plan for your projects, like a warm up then your project routes all in one page/list somewhere or something similar.'),(20,150,'It is good since you get to keep track of all the routes that you have sent/flashed .'),(21,122,'On the Statistics page, first Top Rope list is written Tope Rope :)'),(22,173,'When in a specific gym zone, it would be nice to have a button to go back to the gym\'s list of zones instead of having to use the browser\'s back button.'),(23,175,'It\'d be cool to be able to add tags to routes... \"Dyno\" or \"Crimpy\" etc. Also to upload a picture of the route to help people remember them'),(24,189,'Allow the approved route setters to add the routes they set on their own. Instead of requiring the gym account to do all the work.');
/*!40000 ALTER TABLE `suggestions` ENABLE KEYS */;
UNLOCK TABLES;

